uint32_t CharSelect(void){
	//inputs: none
	//outputs: 0 for pikachu, 1 for lucario
	//Sound_Stop();
	uint32_t selection;
	uint32_t count;
	uint16_t black = ST7735_Color565(0, 0, 0);
	char choose[]={0x43, 0x68, 0x6F, 0x6F, 0x73, 0x65, 0x20, 0x79, 0x6F, 0x75, 0x72, 0x20, 0x50, 0x6F, 0x6B, 0x65, 0x6D, 0x6F, 0x6E, 0x21, 0x00};
	char choosepik[]={0x50, 0x69, 0x6B, 0x61, 0x63, 0x68, 0x75, 0x00};
	char chooseluc[]={0x4C, 0x75, 0x63, 0x61, 0x72, 0x69, 0x6F, 0x00};
	char attack[]={0x41, 0x74, 0x74, 0x61, 0x63, 0x6B, 0x20, 0x74, 0x6F, 0x20, 0x73, 0x74, 0x61, 0x72, 0x74, 0x00};
		
	//PortE_Init1();
	ST7735_FillScreen(0xEEF8);
	count = ST7735_DrawString(2, 3, &choose[0], black);// 1 should be 0ish, 2 should be 3ish
	//ST7735_DrawBitmap(25, 80, pik2, 34, 33);// 20 should be 25, 100 should be 80
	//ST7735_DrawBitmap(88, 80, luc1, 35, 49);// 70 should be 88ish, 100 should be 80
	count = ST7735_DrawString(4, 10, &choosepik[0], black);// 2 should be 1ish, 13 should be 17ish
	count = ST7735_DrawString(14, 10, &chooseluc[0], black);//12 should be 9, 13 should be 17ish
	count = ST7735_DrawString(3, 15, &attack[0], black);//3 should be 2ish, 15 should be 20
	
	while((GPIO_PORTE_DATA_R&0x10)==0){//while pe4 not pressed
		//Sound_Select();
		data = ADC_In();
		if(data > 2047){// if select lucario
			ST7735_DrawBitmap(25, 97, &pik1[0], 34, 33);// 20 should be 25, 100 should be 80
			ST7735_DrawBitmap(88, 100, &luc2[0], 33, 50);// 70 should be 88ish, 100 should be 80
			selection=LUCARIO;
		}
		if(data <= 2047){// if select pikachu
			ST7735_DrawBitmap(25, 97, &pik2[0], 34, 33);// 20 should be 25, 100 should be 80
			ST7735_DrawBitmap(88, 100, &luc1[0], 35, 49);// 70 should be 88ish, 100 should be 80
			selection=PIKACHU;
		}
	}
	
	return selection;
}
